def to_object():

	result = []


	for chain in cadenas:

		tTheaters = []

		for cine in chain['cines']:

			tMovies = []

			for movie in cine['cartelera']:

				tMovies.append(
					Movie(
						name = movie['pelicula'],
						showtimes = movie['horarios'],
						isSubtitled = movie['isSubtitulada'],
						isTranslated = movie['isDoblada'],
						isHD = movie['isHD'],
						is3D = movie['is3D']
				))

			tTheaters.append(
				Theater(
					name = cine['cine'],
					movies = tMovies
			))


		result.append(
			TheaterChain(
				name = chain['cadena'],
				tag = chain['tag'],
				theaters = tTheaters
		))

	return result


